import React from "react";
import Service from "../Items/Service";

const servicesData = [
  {
    id: 1,
    name: "Web Development",
    content: "I build websites using HTML, CSS, JavaScript etc., always adhering to internationally-recognised W3C standards.",
    icon: "icon-globe",
  },
  {
    id: 2,
    name: "Design",
    content: "Lorem ipsum dolor sit amet consectetuer elit.",
    icon: "icon-chemistry",
  },
  {
    id: 3,
    name: "Advertising",
    content: "Lorem ipsum dolor sit amet consectetuer elit.",
    icon: "icon-directions",
  },
  {
    id: 4,
    name: "SEO",
    content: "Lorem ipsum dolor sit amet consectetuer elit.",
    icon: "icon-rocket",
  },
  {
    id: 5,
    name: "Copy Write",
    content: "Lorem ipsum dolor sit amet consectetuer elit.",
    icon: "icon-note",
  },
  {
    id: 6,
    name: "Support",
    content: "Lorem ipsum dolor sit amet consectetuer elit.",
    icon: "icon-bubbles",
  },
];

function Services() {
  return (
    <div className="row -mt-20">
      {servicesData.map((service) => (
        <div className="col-md-4 col-sm-6 mt-20" key={service.id}>
          <Service service={service} />
        </div>
      ))}
    </div>
  );
}

export default Services;
